import React from 'react';
import './Header.css';
import CreateRoomButton from '../containers/CreateRoomButton';
import store from '../store';
const state = store.getState();
console.log("STATE TEST\n" + state.header.room)

export default function Header({ title, room, createRoom }) {
    return (
        <div id="header">
            HEADER
            {title}
            {room}
            {state.header.room}
            <button onClick={() => createRoom()}>ルーム作成</button>
            <CreateRoomButton  />
        </div>   
    )
}
